CREATE OR REPLACE TRIGGER "GYSGLBJ"."DIC_POPEDOM_XH_TRIGGER" BEFORE INSERT ON "GYSGLBJ"."DIC_POPEDOM" REFERENCING OLD AS "OLD" NEW AS "NEW" FOR EACH ROW ENABLE WHEN (new.XH is null)
begin
  select DIC_POPEDOM_XH.nextval into :new.XH from sys.dual;
end dic_popedom_xh_trigger;
